        {ItemDate: '28th March 2021', title: 'Item 1', price: '19.4'},
        {ItemDate: '28th March 2021', title: 'Item 1', price: '19.4'},
        {ItemDate: '28th March 2021', title: 'Item 1', price: '19.4'}
    ];

    return (
        <ExpenseItem Expenses={Expenses} />
    );
}

export default App;
